"""### 2) 올바른 괄호, Lv.2

[링크](https://school.programmers.co.kr/learn/courses/30/lessons/12909)
"""

def solution(s):
  stack = []
  for c in s:
    if c == '(':
      stack.append(c)
    elif stack == []:
      return False
    else:
      stack.pop()

  return len(stack) == 0

print(solution("()()"))
print(solution("(())()"))
print(solution(")()("))
print(solution("(()("))



"""### 3) 컨트롤 제트, Lv.0

[링크](https://school.programmers.co.kr/learn/courses/30/lessons/120853)
"""

def solution(s): # "1 2 Z 3"
    s_list = s.split()
    stack = []
    # print(s_list)
    for i in s_list:
        if i == 'Z':
            stack.pop()
        else:
            stack.append(int(i))

    answer = sum(stack)

    return answer

print(solution("1 2 Z 3"))
print(solution("10 20 30 40"))
print(solution("10 Z 20 Z 1"))
print(solution("10 Z 20 Z"))
print(solution("-1 -2 -3 Z"))